import './App.css';



function Header (props) {
  console.log(props)
  return (

    <h1>{props.name} Kitchen</h1>
  )
}

function Main (props) {
  return (
    <h2>We serve the {props.adjective} food around. 
    <ul>
      {props.dishes.map((dish) => <li>dishes</li>)}
    </ul>

    </h2>
  )
}

function Footer(props) {
  return (
    <h3>Copyright {props.year}</h3>
  )
}
const dishes = [
  "Macaroni and Cheese",
  "Tofu",
  "Salmon"
]



function App() {
  return (
    <div className = "App">
     <Header name = "Harico's"/>
     <Main adjective = "best"/>
     <Footer year = {new Date().getFullYear()}/>

    </div>
  )


}

export default App;
